import React from "react";
import WithData from "../HOC/WithData";
import ItemList from "../ItemList";
import {WithSwapi} from "../HOC/WithSwapi/WithSwapi";


const mapPersonMethodsToProps = (sw) => ({
    getData: sw.getAllPeople
})
const mapPlanetMethodsToProps = (sw) => ({
    getData: sw.getAllPlanets
})
const mapStarShipMethodsToProps = (sw) => ({
    getData: sw.getAllStarship
})
const showName = ({name}) => <span>{name}</span>
const showNameAndModel = ({name, model}) => <span>{name} ({model})</span>

const PersonList = WithSwapi(mapPersonMethodsToProps)(WithData(withChildFN(showName)(ItemList)));
const PlanetList = WithSwapi(mapPlanetMethodsToProps)(WithData(withChildFN(showName)(ItemList)));
const StarShipList = WithSwapi(mapStarShipMethodsToProps)(WithData(withChildFN(showNameAndModel)(ItemList)));

export {
    PersonList,
    PlanetList,
    StarShipList
}
